import { Flex } from "antd";
import { useEffect, useRef, useState } from "react";
import { IGymDetails } from "../../types/gyms";
import { concatAndUpperCaseActivities } from "../../utils/activities";
import colors from "../../constants/colours";

import { ReactComponent as LocationLogo } from "../../images/home/location.svg";
import { checkIpad, checkIphone } from "../../utils/navigator";

import parser from "html-react-parser";
import activityToSvgMap from "../../images/class-images/activity-map";
import { navigate } from "@reach/router";
import { applicationIcons } from "../../utils/helper";
import {
  createMapsLink,
  toLetterCase,
  toLetterCaseNoUnderscore,
} from "../../utils/string-operation";
import { formatTimeIntToAmPm } from "../../utils/date";
import { Mixpanel } from "../../mixpanel/init";
import { discountTxt, showDiscountText } from "../../utils/offers";
import { useAtom } from "jotai";
import { userDetailsAtom } from "../../atoms/atom";

const maxChar = 250;

interface IGymInfo {
  gymData: IGymDetails;
}

const GymInfo: React.FC<IGymInfo> = ({ gymData }) => {
  const description = `${gymData.description}`;

  let [isTruncated, setIsTruncated] = useState(description.length > maxChar);
  let shortDescription = useRef(description.substring(0, maxChar));
  shortDescription.current.replace(/<br>/, "");

  const [userDetails] = useAtom(userDetailsAtom);

  let showDiscount = showDiscountText(gymData, userDetails);

  const [showTimeOptions, setShowTimeOptions] = useState<Boolean>(false);

  const mapsLink = createMapsLink(gymData.addressLine1, gymData.addressLine2);

  const seeMore = (
    <span>
      ...<u>See more</u>{" "}
    </span>
  );

  const seeLess = (
    <span>
      ...<u>See less</u>{" "}
    </span>
  );

  const navigateToBatches = (activity: string) => {
    const pathname = window.location.pathname;

    if (activity == "all")
      Mixpanel.track("clicked_view_schedule_on_gym", {
        gymId: gymData.gymId,
      });
    else
      Mixpanel.track("clicked_activities_on_gym", {
        gymId: gymData.gymId,
        activity,
      });
    navigate(`${pathname}/batch?activity=${activity.toLowerCase()}`);
  };

  const exclusiveIcon = () => {
    return (
      <div
        className="specialWrap"
        style={{ width: "64px", borderRadius: "4px" }}
      >
        <span className="specialTxt">Trending</span>

        <span className="specialIcon">
          <svg
            xmlns="http://www.w3.org/2000/svg"
            width="12"
            height="13"
            viewBox="0 0 12 13"
            fill="none"
          >
            <path
              opacity="0.8"
              d="M7.73192 1.88364L8.61499 3.40904L10.3478 3.73162L8.82239 4.61468L8.49981 6.34748L7.61674 4.82208L5.88394 4.4995L7.40934 3.61644L7.73192 1.88364Z"
              fill="#FFF7CC"
            />
            <path
              d="M3.88235 3.25586L4.93094 6.08962L7.76471 7.13821L4.93094 8.1868L3.88235 11.0206L2.83377 8.1868L0 7.13821L2.83377 6.08962L3.88235 3.25586Z"
              fill="#FFF7CC"
            />
          </svg>
        </span>
      </div>
    );
  };

  const igLogo = () => {
    return (
      <svg
        xmlns="http://www.w3.org/2000/svg"
        xmlnsXlink="http://www.w3.org/1999/xlink"
        width="20"
        height="20"
        viewBox="0 0 20 20"
        fill="none"
      >
        <rect width="20" height="20" fill="url(#pattern0_1132_9238)" />
        <defs>
          <pattern
            id="pattern0_1132_9238"
            patternContentUnits="objectBoundingBox"
            width="1"
            height="1"
          >
            <use xlinkHref="#image0_1132_9238" transform="scale(0.000488281)" />
          </pattern>
          <image
            id="image0_1132_9238"
            width="2048"
            height="2048"
            xlinkHref="data:image/png;base64,"
          />
        </defs>
      </svg>
    );
  };

  // const amenitiesIconMap={
  //   'GROUP_CLASSES':
  // }

  const amenities = (amenety: string) => {
    return (
      <span
        style={{
          display: "flex",
          alignItems: "center",
        }}
      >
        <span style={{ marginRight: "8px" }}>{applicationIcons(amenety)}</span>
        <span className="amenety">{toLetterCaseNoUnderscore(amenety)}</span>
      </span>
    );
  };

  const Gicon = () => {
    return (
      <svg
        xmlns="http://www.w3.org/2000/svg"
        width="15"
        height="20"
        viewBox="0 0 15 20"
        fill="none"
      >
        <rect width="15" height="20" fill="url(#pattern0_1195_108)" />
        <defs>
          <pattern
            id="pattern0_1195_108"
            patternContentUnits="objectBoundingBox"
            width="1"
            height="1"
          >
            <use
              xlinkHref="#image0_1195_108"
              transform="matrix(0.00199435 0 0 0.00149577 -0.00750023 0.15)"
            />
          </pattern>
          <image
            id="image0_1195_108"
            width="512"
            height="512"
            xlinkHref="data:image/png;base64,"
          />
        </defs>
      </svg>
    );
  };

  const starIcon = () => {
    return (
      <svg
        xmlns="http://www.w3.org/2000/svg"
        width="11"
        height="11"
        viewBox="0 0 11 11"
        fill="none"
      >
        <path
          d="M2.292 10.144L3.432 6.628L0.432 4.444H4.14L5.28 0.916L6.432 4.444H10.14L7.14 6.628L8.292 10.144L5.28 7.972L2.292 10.144Z"
          fill="#05070B"
        />
      </svg>
    );
  };

  const clockIcon = () => {
    return (
      <svg
        xmlns="http://www.w3.org/2000/svg"
        width="16"
        height="16"
        viewBox="0 0 16 16"
        fill="none"
      >
        <g clip-path="url(#clip0_1217_5785)">
          <path
            d="M7.99967 4.00065V8.00065L10.6663 9.33398M14.6663 8.00065C14.6663 11.6826 11.6816 14.6673 7.99967 14.6673C4.31778 14.6673 1.33301 11.6826 1.33301 8.00065C1.33301 4.31875 4.31778 1.33398 7.99967 1.33398C11.6816 1.33398 14.6663 4.31875 14.6663 8.00065Z"
            stroke="#05070B"
            stroke-linecap="round"
            stroke-linejoin="round"
          />
        </g>
        <defs>
          <clipPath id="clip0_1217_5785">
            <rect width="16" height="16" fill="white" />
          </clipPath>
        </defs>
      </svg>
    );
  };

  const infoIcon = () => (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      width="16"
      height="16"
      viewBox="0 0 16 16"
      fill="none"
    >
      <g clip-path="url(#clip0_1842_406)">
        <path
          d="M7.99967 10.6673V8.00065M7.99967 5.33398H8.00634M14.6663 8.00065C14.6663 11.6826 11.6816 14.6673 7.99967 14.6673C4.31778 14.6673 1.33301 11.6826 1.33301 8.00065C1.33301 4.31875 4.31778 1.33398 7.99967 1.33398C11.6816 1.33398 14.6663 4.31875 14.6663 8.00065Z"
          stroke="#4F4F4F"
          stroke-width="1.2"
          stroke-linecap="round"
          stroke-linejoin="round"
        />
      </g>
      <defs>
        <clipPath id="clip0_1842_406">
          <rect width="16" height="16" fill="white" />
        </clipPath>
      </defs>
    </svg>
  );

  const discountLine = () => {
    return showDiscount ? (
      <div className="discountLine1">{discountTxt}</div>
    ) : null;
  };

  const gRate = (val: any) => {
    return val.googleRating > 0;
  };
  return (
    <>
      <div
        style={{
          padding: "16px 24px",
        }}
      >
        <div>
          <div style={{ marginBottom: "10px" }}>
            {gymData.isExclusive && exclusiveIcon()}
          </div>
          <div className="gymName">{gymData.name}</div>
          <div style={{ marginBottom: "16px" }}>
            {showDiscount ? (
              <span>
                <span className="slashed-price"> ₹{gymData.minPrice} </span>
                <span className="price">
                  {" "}
                  ₹{Math.floor(gymData.minPrice / 2)}&nbsp;onwards
                </span>
              </span>
            ) : (
              <span className="price">₹{gymData.minPrice} onwards</span>
            )}

            {gRate(gymData) && (
              <>
                <span style={{ margin: "0px 4px" }}>&bull;</span>

                <span className="gRating">
                  <span className="gIcon">{Gicon()}</span>
                  <span style={{ marginLeft: "16px", marginRight: "4px" }}>
                    |
                  </span>
                  <span>{gymData.googleRating}</span>
                  <span>{starIcon()}&nbsp;</span>
                  <span>({gymData.googleReviews})</span>
                </span>
              </>
            )}
          </div>
          {gymData.area && (
            <>
              <div className="line"></div>
              <div className="locWrp">
                <span className="baseTxt">
                  <LocationLogo style={{ marginRight: "8px" }} /> {gymData.area}
                </span>
                <span
                  onClick={() => {
                    Mixpanel.track("clicked_location_on_gym", {
                      gymId: gymData.gymId,
                    });
                    window.open(mapsLink);
                  }}
                  className="baseTxt"
                  style={{ textDecoration: "underline" }}
                >
                  View on map
                </span>
              </div>
              <div className="line"></div>
              <div className="locWrp">
                <div className="timeWrapper">
                  <span>{clockIcon()}</span>
                  <span>
                    {gymData.operatingHours.map((time: any, idx1) => {
                      if (idx1 > 0 && !showTimeOptions) {
                        return;
                      }
                      return (
                        <div className="timeWrap" key={idx1}>
                          <span className="timeDay">
                            {toLetterCase(time.day)} :{" "}
                          </span>
                          <span className="timeHours">
                            {time.times.map((t: any, idx2: any) => {
                              return (
                                <>
                                  <span key={`${t.startTime}-${t.endTime}`}>
                                    {formatTimeIntToAmPm(t.startTime)} -{" "}
                                    {formatTimeIntToAmPm(t.endTime)}
                                  </span>
                                  <span style={{ margin: "0px 4px" }}>
                                    {idx2 === 0 && time.times.length > 1 && "|"}
                                  </span>
                                </>
                              );
                            })}
                          </span>
                          <span
                            className="info"
                            onClick={() => {
                              Mixpanel.track("clicked_operating_hours_on_gym", {
                                gymId: gymData.gymId,
                              });
                              setShowTimeOptions(!showTimeOptions);
                            }}
                          >
                            {idx1 == 0 && infoIcon()}
                          </span>
                        </div>
                      );
                    })}
                  </span>
                </div>
              </div>
              <div className="line"></div>
            </>
          )}
        </div>
        <div className="gymPageheading">
          <div>Choose Activity</div>
        </div>
        <div className="activities">
          {gymData?.activities?.map((activity: string) => {
            return (
              <span
                style={{
                  marginRight: "16px",
                  height: "90px",
                  display: "inline-block",
                }}
                onClick={() => {
                  // navigate(`/batch?activity=${activity.toLowerCase()}`)
                  // navigate(`/batch`)
                  navigateToBatches(activity);
                }}
              >
                {activityToSvgMap(activity)}
              </span>
            );
          })}
        </div>
        <div className="gymPageheading">About Center</div>
        <div
          className="gPageDesc"
          onClick={() => {
            setIsTruncated(!isTruncated);
          }}
        >
          {isTruncated ? (
            <div>
              {shortDescription.current}
              <span>{seeMore}</span>
            </div>
          ) : description.length > maxChar ? (
            <div>
              {parser(description)}
              <span>{seeLess}</span>
            </div>
          ) : (
            <div>{parser(description)}</div>
          )}
        </div>
        {gymData.amenities.length > 0 && (
          <>
            {" "}
            <div className="gymPageheading">Amenities</div>
            <div className="amenities">
              {gymData.amenities.map((a) => {
                return <span className="amenitiesItem">{amenities(a)}</span>;
              })}
            </div>
          </>
        )}
        <div className="line"></div>
        <div className="locWrp">
          <span className="baseTxt">
            {igLogo()} <span style={{ marginLeft: "8px" }}> INSTAGRAM</span>
          </span>
          <span className="baseTxt" style={{ textDecoration: "underline" }}>
            <a className="baseTxt" href={gymData?.instaLink} target="_blank">
              View Profile
            </a>
          </span>
        </div>
        {gymData.addressLine1 && (
          <>
            <div className="line"></div>
            <div className="locWrp">
              <div>
                <div className="baseTxt">
                  <LocationLogo
                    style={{ marginRight: "8px", marginBottom: "4px" }}
                  />{" "}
                  Address
                </div>
                <div
                  className="baseTxt"
                  style={{ color: "#828081", marginLeft: "16px" }}
                >
                  {gymData.addressLine1},{gymData.addressLine2}
                </div>
              </div>
            </div>
          </>
        )}
      </div>
      <div className="bookBtnWrap">
        {/* {discountLine()} */}
        <button
          className={showDiscount ? "bookBtn" : "bookBtn2"}
          onClick={() => navigateToBatches("all")}
        >
          View Schedule
        </button>
      </div>
    </>
  );
};

export default GymInfo;
